angular.module('templates', []).run(['$templateCache', function($templateCache) {$templateCache.put('components/card/card.template.html','<div id="card" ng-class="{\'flipped\':isFlipped}" ng-click="isFlipped=!isFlipped">\r\n    <div class="ribbon" ng-if="!isFlipped" ng-class="$ctrl.getRibbonClass($ctrl.info.type)"><span>{{$ctrl.info.type}}</span></div>\r\n    <div class="side card-front">\r\n        <i class="material-icons" ng-if="$ctrl.info.type === \'starships\'">flight_takeoff</i>\r\n        <i class="material-icons" ng-if="$ctrl.info.type === \'planets\'">language</i>\r\n        <i class="material-icons" ng-if="$ctrl.info.type === \'people\'">people</i>\r\n        <div class="overlay"></div>\r\n        <div class="info">\r\n            {{$ctrl.info.name}}\r\n        </div>\r\n    </div>\r\n    <div class="side card-back">\r\n        <div class="header">\r\n            <h3>INFO</h3>\r\n            <i class="material-icons">close</i>\r\n        </div>\r\n        <div class="details-wrapper">\r\n            <div class="detail" ng-repeat="detail in $ctrl.cardInfo">\r\n                <label>{{detail.label}}</label>\r\n                <p>{{detail.value}}</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n');
$templateCache.put('components/cards/cards.template.html','<div class="col-sm-12 layout">\r\n    <ul class="{{$root.activeClass}}">\r\n        <li ng-repeat="tab in $ctrl.tabs" ng-click="$ctrl.changeTab(tab)" ng-class="{ \'activeTab\' : $ctrl.activeTab === tab}">{{tab | uppercase}}</li>\r\n    </ul>\r\n    <div class="cards-wrapper">\r\n        <card ng-repeat="cardInfo in $ctrl.cards track by $index" info="cardInfo" class="card col-lg-3 col-md-4 col-sm-6 col-xs-12 animated bounceInDown"></card>\r\n    </div>\r\n</div>');}]);